import '../css/History.css';
import React from 'react';

export default class History extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      correctHistory: ['This is ', 'Another ', 'One more item', ''],
      incorrectHistory: ['America', 'item', '', 'Last item'],
      currentIndex: 0,
    };
  }    

  handleLeft = () => {
    this.setState((prevState) => ({
      currentIndex: prevState.currentIndex === 0 ? prevState.correctHistory.length - 1 : prevState.currentIndex - 1,
    }));
  };

  handleRight = () => {
    this.setState((prevState) => ({
      currentIndex: prevState.currentIndex === prevState.correctHistory.length - 1 ? 0 : prevState.currentIndex + 1,
    }));
  };

  render() {
    const { correctHistory, incorrectHistory, currentIndex } = this.state;
    const currentCorrectItem = correctHistory[currentIndex];
    const currentIncorrectItem = incorrectHistory[currentIndex];
    return (
      <div id="history-wrapper">
        <div id="history">
          <div id="history-main">
            <p onClick={this.handleLeft}>{'<'}</p>
            <div id="history-item">
              <p id="history-item-correct">{currentCorrectItem}</p>
              <p id="history-item-incorrect">{currentIncorrectItem}</p>
            </div>
            <p onClick={this.handleRight}>{'>'}</p>
          </div>
          <div id="history-pages-number">
            <p>{`${currentIndex + 1}/${correctHistory.length}`}</p>
          </div>
        </div>
      </div>
    );
  }
}
